INSERT INTO `lo` (`id`, `nev`, `kep`, `oktato_id`, `bemutatkozas`) VALUES
(4, 'Rocky', , NULL, 'A bajnokok bajnoka Póni!Ha kezdő vagy ha Profi de még fiatal akkor szívesen várlak a hátamra.Ha pedig versenyre megyünk és együtt veszünk részt a dobogón végzed az tuti!');
INSERT INTO `lo` (`id`, `nev`, `kep`, `oktato_id`, `bemutatkozas`) VALUES
(5, 'Duci/Mythos/', , NULL, 'Futószáras vagy Osztály paci is vagyok.Kicsit lustácska de ha erélyes vagy hamar felébredek és miénk lesz az egész pálya.Egyébként meg egy imádni való kis póni vagyok.');
INSERT INTO `lo` (`id`, `nev`, `kep`, `oktato_id`, `bemutatkozas`) VALUES
(6, 'Don zseton', , NULL, 'Szuper kis Sportpóni vagyok!Ha valamit csinálok azt akkor csakis szívvel-lélekkel.És persze jól.Hiperaktív vagyok szóval nem lehet könnyen elfáradni a hátamon.');
INSERT INTO `lo` (`id`, `nev`, `kep`, `oktato_id`, `bemutatkozas`) VALUES
(7, 'Csinos', , NULL, 'Nem egy átlagos kinézetű ló vagyok,de a nevemből adódóan láthatjátok is, hogy milyen kis csini vagyok.Külsőmet félre téve nagyon cuki vagyok bárkit elviszek a hátamon jó mestere vagyok kicsiknek nagyoknak egyaránt.');
INSERT INTO `lo` (`id`, `nev`, `kep`, `oktato_id`, `bemutatkozas`) VALUES
(8, 'Império', , NULL, 'Sajnos sűrűn nem vagyok használható az ínszakadásom miatt.De mikor dolgozom abban szuper vagyok és segítem a lovasomat amiben csak tudom.Rajtengedélyre én vagyok a legjobb választás.');
INSERT INTO `lo` (`id`, `nev`, `kep`, `oktato_id`, `bemutatkozas`) VALUES
(9, 'Lili', , NULL, 'Futószarás kis kanca póni vagyok!Többnyire a legkisebbeket tanítom mivel egy rossz mozdulatom sincsen!És nem okoz gondot nekem ha lassan kell menni.');
INSERT INTO `lo` (`id`, `nev`, `kep`, `oktato_id`, `bemutatkozas`) VALUES
(10, 'Pitypang/Pityu/', , NULL, 'Alapvetőleg egy rendes kanca sportpóni vagyok.Általában osztályban megyek.Ha ugratásra kerül a sor figyelj oda mert em vagyok a legmegbízhatóbb póni.Szeretek kitérni vagy megállni.DE ha olyan napom van akkor szuperül teljesítek.');
INSERT INTO `lo` (`id`, `nev`, `kep`, `oktato_id`, `bemutatkozas`) VALUES
(11, 'Szellő', , NULL, 'Ahogy a barátnőm is úgy én is a legkisebbeket okítom a hátamon.Engem versenyszezonban lehet látni ügyességi számokban.Szuperül együtt tudok működni picike lovasaimmal.Bennem sem fogtok csalódni.');
INSERT INTO `lo` (`id`, `nev`, `kep`, `oktato_id`, `bemutatkozas`) VALUES
(12, 'Vándor', , NULL, 'Arab herélt kis paci vagyok, de nem vagyok már mai csirke, és a hízás sem megy már úgy nekem, de a munkában jól teljesítek.Szoktam néha érdekes mozdulatokat csinálni szóval azért legyél résen!De egyébként meg nagyon is szerethető vagyok.');

