--
-- A tábla adatainak kiíratása `oktato`
--

INSERT INTO `oktato` (`id`, `nev`, `kep`, `bemutatkozas`) VALUES
(9, 'Kirchner Szilvia', , 'Kirchner Szilvia vagyok, a Carlo Lovassport Egyesület elnöke és vezetője.  Ahogy a mondás is tartja, amióta az eszemet tudom szeretem és tisztelem a lovakat. Gyerekkorom óta szoros kapcsolatban vagyok a lovakkal, annak ellenére, hogy  nem lovas családból származom. Első lovamat Carlo-t 2000 őszén kaptam, majd miután sikeres rajtengedély vizsgát tettem díjugratásban kezdtem versenyezni. Későbbiekben Carlo mellett Napsugár nevű kancám is a család tagja lett, így már két lóval volt lehetőségem készülni versenyről versenyre. Ahogy múltak az évek egyre inkább a tanítványaimra fektettem a nagyobb hangsúlyt így 2007ben a versenyzést abbahagytam és edzőként folytattam a munkámat. Munkám során mindig is nagy hangsúlyt fektettem az alapokra. Hiszem azt hogy csak stabil alapokra fektetett tudást lehet folyamatosan gyarapítani. Munkámat napjainkban is hivatásszerűen űzöm, a lovak az életem részévé váltak.\r\n');
INSERT INTO `oktato` (`id`, `nev`, `kep`, `bemutatkozas`) VALUES
(10, 'Szatmári Szilvia(Száncsó)', , 'Sziasztok!\r\nKiskorom óta az életem meghatározó része a lovarda, a lovaglás, a lovakkal való munka. Szerencsésnek érzem magam, hogy lovak mellett nőhettem fel, és hogy most másokat vezethetek be ebbe a különleges világba. Mondhatni kiválasztott magának ez a szakma a maga kihívásokkal teli varázsával.  A lovassport által magabiztosabb lettem, kitartást, felelősségérzetet, szorgalmat tanultam. Hálás vagyok anyukámnak, hogy lehetővé tette ezt, és minden edzőnek, akikkel volt szerencsém lovagolni legfőképp Kirchner Szilvinek, hogy mindig támogattak és azt csinálhatom, amit szeretek. Hálával tartozom minden lovasomnak és lónak, hogy együtt tanulhatunk. Munkám során fontosnak tartom, nemcsak a biztos alapülés de a lovak ápolásának, gondozásának oktatását is, mindezt családias hangulatban, egyénre szabott ütemben. Szívesen dolgozom együtt kisgyermekekkel és felnőttekkel egyaránt, nagy öröm végig kísérni a fejlődésüket, támogatni céljaikat, álmaikat, legyen az verseny, tereplovaglás, vagy csak mozogni egy jót. Versenyzői múltammal és ambícióimmal, gyakorlatias jellememmel igyekszem jó példát mutatni, érzékeltetni, hogy nincs lehetetlen. A jövőben is szeretnék még tovább tanulni, alkalmazkodni változó világunk igényeihez, kihívásaihoz.\r\n');

